import './TextTitles.css';
const TextTitles = ({img,titulo,h1,h4,claseCont}) => {
  return (
    <div className={"d-flex"}>
    <img className='textTitle-title' src={img} />
    <h5>{titulo}</h5>
    <h1 className="display-3">{h1}</h1>
    <h4>
     {h4}
    </h4>
  </div>
  )
}

export default TextTitles
